def count_primes(n):
    """
    Given a positive integer n, return the number of prime numbers less than or
    equal to n.

    Note: A prime number is a positive integer greater than 1 that is divisible
    only by 1 and itself.
    """
    prime_list = []
    for i in range(2, n+1):
        for j in range(2, i):
            if i % j == 0:
                break
        else:
            prime_list.append(i)
    return sum(prime_list)
